                  <img src={image} className={classes.imagepopup}></img>
                  {/* {props.marker.image} */}
                </TableCell>
              </TableRow>
              <TableRow>
                <TableCell align="center"> Loại vi phạm </TableCell>
                <TableCell component="th" scope="row">
                  {/* {props.marker.type} */}
                  {/* {props.marker.image} */}
